import numpy as np
import cv2
from matplotlib import pyplot as plt
from google.colab.patches import cv2_imshow
from cv2.gapi import threshold

def detect_edges(image , threshold , k_size):
  img = cv2.imread(image)
  img_grayscale = cv2.cvtColor(img, cv2.COLOR_BGR2GRAY)
  median_filtered_img = cv2.medianBlur(img_grayscale, 3)
  laplacian_img = cv2.Laplacian(median_filtered_img, -1, ksize=k_size)
  threshold_img = cv2.threshold(laplacian_img, threshold, 255, cv2.THRESH_BINARY_INV)[1]

  print("      orignal image:")
  cv2_imshow(img)
  print("      grayscale image:")
  cv2_imshow(img_grayscale)
  print("Smoothed Grayscale image using median filter:")
  cv2_imshow(median_filtered_img)
  print("      laplacian image:")
  cv2_imshow(laplacian_img)
  print("      threshold image:")
  cv2_imshow(threshold_img)

  return threshold_img

