def bilateral_filter(image, filter_size, color_strength, positional_strength, repetition_count):
  img = cv2.imread(image)
  for i in range(repetition_count):
    img = cv2.bilateralFilter(img, filter_size, color_strength, positional_strength)
  print("image after appling bilateral_filter :")
  cv2_imshow(img)
  return img

img_painting =bilateral_filter('img2.png' , 9 , 20 , 20 , 3)

def merge(original_img ,edges_img , bilateral_img ):

  img = cv2.imread(original_img)
  cartoon = np.zeros_like(img )
  for i in range(len(img)):
    for j in range (len(img[0])):
      if(edges_img[i][j]!=0):
        cartoon[i][j] = bilateral_img[i][j]

  print("Final Cartoon image:")

  cv2_imshow(cartoon)

