def edge_detection(img, min_value, max_value):

  gray_img = cv2.cvtColor(img, cv2.COLOR_BGR2GRAY)
  smoothed_img = cv2.medianBlur(gray_img, 7)
  # Apply Canny edge detection
  edges_img = cv2.Canny(gray_img, min_value, max_value)

  plt.figure(figsize=(20, 15))
  plt.subplot(2, 2, 1)
  plt.title('Original Image')
  plt.axis('off')
  plt.imshow(cv2.cvtColor(img, cv2.COLOR_BGR2RGB))

  plt.subplot(2, 2, 2)
  plt.axis('off')
  plt.title('Grayscale image')
  plt.imshow(gray_img, cmap='gray')

  plt.subplot(2, 2, 3)
  plt.axis('off')
  plt.title('Smoothed grayscale image using median filter')
  plt.imshow(smoothed_img, cmap='gray')

  plt.subplot(2, 2, 4)
  plt.axis('off')
  plt.title('Image after edge detection')
  plt.imshow(edges_img, cmap='gray')

  plt.show()

  return edges_img

