def ROI(height, width, num):
  # Define the polygon region
  if num==1:
    bottom_left = (0, height)
    bottom_right = (0.8*width, height)
    top_right = (0.75*width, 0.5*height)
    top_left = (0, 0.6*height)
  elif num==2:
    bottom_left = (0, height)
    bottom_right = (width, height)
    top_right = (width, 0.65*height)
    top_left = (0, 0.65*height)
  elif num==3:
    bottom_left = (0, height)
    bottom_right = (width, height)
    top_right = (width, 0.65*height)
    top_left = (0, 0.65*height)

  roi_vertices = np.array([[bottom_left, bottom_right, top_right, top_left]], np.int32)
  return roi_vertices

def mask_ROI(img, num):   # img: image after edge detection by Canny's algorithm
  mask = np.zeros_like(img)

  if len(img.shape) > 2:
    channels = img.shape[2]    # 3 channels in RGB
    fill_color = (255,) * channels
  else:
    fill_color = 255

  cv2.fillPoly(mask, ROI(img.shape[0], img.shape[1], num), fill_color)
  return cv2.bitwise_and(img, mask)

