def Accumilation(img):
  height,width = img.shape
  max_theta = 180
  max_rho = int(np.ceil(np.sqrt(width**2 + height**2)))
  H = np.zeros((max_theta+1, 2*max_rho+1))
  for y in range(len(img)):
    for x in range(len(img[0])):
      if img[y,x] != 0:
        for theta in range(0, max_theta+1, 1):
          rad_theta = np.deg2rad(theta)
          rho = int(np.ceil(max_rho + (x*np.cos(rad_theta)+y*np.sin(rad_theta))))   # +max_rho for -ve rohs
          H[theta,rho]+=1
  return H

