def local_maximum(H, votes):
  for theta, rho in np.ndindex(H.shape):
      if H[theta, rho] < votes:
        H[theta, rho] = 0
      # else:
      #   H[theta, rho] = 1

def non_maximum_supression(H):
  neighbours = np.zeros(9)
  for theta, rho in np.ndindex(H.shape):
      neighbours[0] = H[theta, rho]            #current pixel
      # pixel's neighbours
      if rho+1 < len(H[0]):
        neighbours[1] = H[theta, rho+1]        #up
      if rho-1 > -1:
        neighbours[2] = H[theta, rho-1]        #down
      if theta+1 < len(H):
        neighbours[3] = H[theta+1, rho]        #right
      if theta-1 > -1:
        neighbours[4] = H[theta-1, rho]        #left
      if theta+1 < len(H) and rho+1 < len(H[0]):
        neighbours[5] = H[theta+1, rho+1]      #diagnol_up_right
      if theta-1 > -1 and rho-1 > -1:
        neighbours[6] = H[theta-1, rho-1]      #diagnol_down_left
      if theta-1 > -1 and rho+1 < len(H[0]):
        neighbours[7] = H[theta-1, rho+1]      #diagnol_up_left
      if theta+1 < len(H) and rho-1 > -1:
        neighbours[8] = H[theta+1, rho-1]      #diagnol_up_right

      if np.argmax(neighbours) != 0:           # if the current pixel is not the maximum among its neighbours
        H[theta, rho] = 0                      # then set it to 0

def draw_lines(img, thetas, rhos):
  myImg = np.copy(img)
  n = 2000
  for i in range(len(thetas)):
    cos_theta = np.cos(thetas[i])
    sin_theta = np.sin(thetas[i])
    x0 = rhos[i]*cos_theta
    y0 = rhos[i]*sin_theta
    x1 = int(np.ceil(x0 +n*sin_theta))
    y1 = int(np.ceil(y0 -n*cos_theta))
    x2 = int(np.ceil(x0 -n*sin_theta))
    y2 = int(np.ceil(y0 +n*cos_theta))
    cv2.line(myImg, (x1, y1), (x2, y2), (0, 255, 0),2)
  return myImg

def hough_transform(img, roi, votes):
  height,width = roi.shape
  max_rho = int(np.ceil(np.sqrt(width**2 + height**2)))
  H = Accumilation(roi)
  local_maximum(H, votes)
  non_maximum_supression(H)
  thetas, rhos = np.nonzero(H)     #finding parameters
  # print(thetas)
  # print(rhos)
  return draw_lines(img, np.deg2rad(thetas), rhos -max_rho)   # shift the origin of the Hough space to the center by -max_rho

