def lane_detection(img, min, max, votes, img_num):
  edges = edge_detection(img, min, max)
  ROI_img = mask_ROI(edges, img_num)
  cv2_imshow(ROI_img)
  return cv2.bitwise_or(img, mask_ROI(hough_transform(img, ROI_img, votes), img_num))

